import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import Home from './pages/Home';
import Jobs from './pages/Jobs';
import PostJob from './pages/PostJob';
import Login from './pages/Login';

function App() {
  return (
    <div>
          <nav className="bg-gradient-to-r from-blue-600 to-indigo-600 p-4 flex space-x-6 text-white font-bold shadow-lg">
      <Link to="/" className="hover:text-yellow-300 transition-transform transform hover:scale-110">Home</Link>
      <Link to="/jobs" className="hover:text-yellow-300 transition-transform transform hover:scale-110">Jobs</Link>
      <Link to="/post-job" className="hover:text-yellow-300 transition-transform transform hover:scale-110">Post Job</Link>
      <Link to="/login" className="hover:text-yellow-300 transition-transform transform hover:scale-110">Login</Link>
    </nav>


      <div className="p-6">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/jobs" element={<Jobs />} />
          <Route path="/post-job" element={<PostJob />} />
          <Route path="/login" element={<Login />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
